  \"2015-08-21T22:51:08.935963\",\n\t\"name\": \"u-s-forest-service-stewardship-contracting\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"A map service on the www depicting the locations
  of activities within the Stewardship Contracting Project Boundary. Activities are
  implemented through stewardship contracts or agreements and are self-reported by
  Forest Service Units through the FACTS database. Stewardship End Result Contracting
  helps achieve land management goals while meeting local and rural community needs,
  including contributing to the sustainability of rural communities and providing
  a continuing source of local income and employment. It focuses on the \"end result\"
  ecosystem benefits and outcomes, rather than on what's removed from the land. The
